import { FlexPlugin } from "flex-plugin";

const PLUGIN_NAME = "WebNotifyPlugin";

const NEW_MESSAGE_AUDIO = `data:audio/mp3;base64,`;

const NEW_TASK_AUDIO = `data:audio/mp3;base64,`;

const ICON_URL = `data:image/png;base64,`;

export default class WebNotifyPlugin extends FlexPlugin {
  constructor() {
    super(PLUGIN_NAME);
    this.my_id = "";
  }

  init(flex, manager) {
    this.my_id = manager.chatClient.services.users.myself.state.identity;
    manager.workerClient.on("reservationCreated", this.newTask.bind(this, this.notifyMe));
    manager.chatClient.on("messageAdded", this.newMessage.bind(this, this.notifyMe, this.my_id));
  }

  newTask(func, reservation) {
    console.warn("Reservation Created: " + reservation.task.sid);
    if (reservation.task && reservation.task.taskChannelUniqueName) {
      func(`Incoming ${reservation.task.taskChannelUniqueName} (${reservation.task.queueName})`, {
        requireInteraction: true,
        body: `From: ${reservation.task.attributes.name}`,
        icon: ICON_URL,
        audio: NEW_TASK_AUDIO
      });
    }
  }

  newMessage(func, my_id, message) {
    console.warn("Message Added: " + message.body);
    if (message.state.author !== my_id) {
      func("New Message: ", {
        body: `${message.body}`,
        icon: ICON_URL,
        audio: NEW_MESSAGE_AUDIO
      });
    }
  }

  notifyMe(title, options) {
    // Let's check if the browser supports notifications
    if (!("Notification" in window)) {
      console.error("This browser does not support desktop notification");
    }

    // Let's check whether notification permissions have already been granted
    else if (Notification.permission === "granted") {
      // If it's okay let's create a notification
      if (options.audio) {
        new Audio(options.audio).play();
      }
      var notification = new Notification(title, options);
      notification.addEventListener("click", function() {
        console.log("Notification clicked");
      });
    }

    // Otherwise, we need to ask the user for permission
    else if (Notification.permission !== "denied") {
      Notification.requestPermission().then(function(permission) {
        // If the user accepts, let's create a notification
        if (permission === "granted") {
          if (options.audio) {
            new Audio(options.audio).play();
          }
          var notification = new Notification(title, options);
          notification.addEventListener("click", function() {
            console.log("Notification clicked");
          });
        }
      });
    }
    return null;

    // At last, if the user has denied notifications, and you
    // want to be respectful there is no need to bother them any more.
  }
}
